        Route path = '/services'
        component = { Services }
        /> <
        Route path = '/products'
        component = { Products }
        /> <
        Route path = '/singup'
        component = { SingUp }
        />


        <
        /Switch>


        <
        /Router> <
        />
    );
}

export default App;
